import React from 'react';
import auth0 from '../lib/auth0';

const app = (props) => {
    return (
        <div>
            <h1>App</h1>
        </div>
    )
};
export default app;

export async function getServerSideProps({ req, res }) {
    const session = await auth0.getSession(req);
    console.log(session);
    return {
        user: {
            name: 'Tulio'
        }
    }
}
